bool lvl_LoadRaw(int episode_id, int level_id, bool load_local)
{	
	printf("lvl_LoadRaw L=%d EP=%d\n", level_id, episode_id);
	char * tabtemp = NULL;
	if(load_local == false) {
		tabtemp = lvl_getLevelRaw(episode_id, level_id);
		lvl_CopyLevelLocally(tabtemp);
	}
	else {
		tabtemp = lvl_LoadLevelLocally(episode_id, level_id);
	}
	
	int index = 0;
	int level_theme = lvl_getHexaChunkValue(&tabtemp[(index++)*CHUNK_LEN], CHUNK_LEN);
	int level_width = lvl_getHexaChunkValue(&tabtemp[(index++)*CHUNK_LEN], CHUNK_LEN);
	int level_height = lvl_getHexaChunkValue(&tabtemp[(index++)*CHUNK_LEN], CHUNK_LEN);
	
	gHeader.level_w = level_width;
	gHeader.level_h = level_height;
	g_FreeMap();
	g_AllocMap();
	
	int max_pommes = 0;
	for(int i=0 ; i<level_width*level_height ; i++) 
	{
		int blocid = lvl_getHexaChunkValue(&tabtemp[(index++)*CHUNK_LEN], CHUNK_LEN);
		gLevel[i].blocID = '0' + blocid;
		gLevelLocal[i].blocID = '0' + blocid;
		if(blocid == POMME_ID)
			max_pommes ++;
		else if(blocid == BANANE_ID)
			max_pommes += 5;
	}	
	if(load_local == false) {
//		gMaxPomme = max_pommes;
	}
	lvl_UpdateLocalLevelDatas();

	// game analytics ---------------------------------------------------
	char episodeStr[32];
	char stageStr[32];
	sprintf(episodeStr, "Episode_%d", episode_id);
	sprintf(stageStr, "Stage_%d", level_id + 1);
	//gameanalytics::GameAnalytics::addProgressionEvent(gameanalytics::EGAProgressionStatus::Start, episodeStr, stageStr, NULL);

	return true;
}

void lvl_UpdateLocalLevelDatas()
{
	int lsize = gHeader.level_w*gHeader.level_h;
	int lsize_ = sizeof(char)*(lsize+3)*3;
	char *str = (char*)malloc(lsize_);
	memset(str, 0, lsize_);
	char *p = str;
	sprintf(p, "%.3x", 0);
	p += 3;
	sprintf(p, "%.3x", gHeader.level_w);
	p += 3;
	sprintf(p, "%.3x", gHeader.level_h);
	p += 3;
	for(int i=0 ; i<lsize ; i++) 
	{
		int blocid = gLevelLocal[i].blocID - '0';
		sprintf(p, "%.3x", blocid);
		p += 3;
	}	
	lvl_CopyLevelLocally(str);
}

