int lvl_getHexaChunkValue(char *tab, int size)
{
	int resultat = 0;
	int npow = 1;
	for(int i=size-1 ; i>=0 ; i--) {
		int value = npow * lvl_getHexaValue(tab[i]);
		resultat += value;
		npow *= 16;
	}
	return resultat;
}

int lvl_getHexaValue(int hexa)
{
	switch(hexa) 
	{
		case '0':	return 0;		
		case '1':	return 1;			
		case '2':	return 2;			
		case '3':	return 3;			
		case '4':	return 4;			
		case '5':	return 5;			
		case '6':	return 6;			
		case '7':	return 7;			
		case '8':	return 8;			
		case '9':	return 9;			
		case 'A':	return 10;
		case 'B':	return 11;
		case 'C':	return 12;			
		case 'D':	return 13;			
		case 'E':	return 14;			
		case 'F':	return 15;
		case 'a':	return 10;
		case 'b':	return 11;
		case 'c':	return 12;			
		case 'd':	return 13;			
		case 'e':	return 14;			
		case 'f':	return 15;
	}
	return 0;
}


// NOTE: si tout les diamants sont pris dans le world alors on debloque le stage bonus
int g_GetNBunlockedLevel(int episodeID)
{
	int		i;
	bool	all_diamants;
/*	
	for(i=0 ; i<GAME_MAXLEVELS ; i++) {
		world1_stat[i] = 3; 
		world1_stat[i] = 3; 
		world1_stat[i] = 3; 
	}
	return GAME_MAXLEVELS+1; //
*/
	all_diamants = true;
	switch(episodeID)
	{
		case 1:
		for(i=0 ; i<GAME_MAXLEVELS ; i++)
		if(world1_stat[i] == 0)
			return i+1;
		else if(world1_stat[i] == 1)
			all_diamants = false;
		break;

		case 2:
		for(i=0 ; i<GAME_MAXLEVELS ; i++)
		if(world2_stat[i] == 0)
			return i+1;
		else if(world2_stat[i] == 1)
			all_diamants = false;
		break;

		case 3:
		for(i=0 ; i<GAME_MAXLEVELS ; i++)
		if(world3_stat[i] == 0)
			return i+1;
		else if(world3_stat[i] == 1)
			all_diamants = false;
		break;

		default:
		return 0;
	}

	if(all_diamants)
		return GAME_MAXLEVELS+1;
	return GAME_MAXLEVELS;
}

void g_SetLevelCleared(int episodeID, int levelID, bool LevelCleared, bool DiamantGrabed)
{
	int	UnlockValue;

	if(levelID < 1 || levelID > GAME_MAXLEVELS)
		return;
	switch(episodeID)
	{
		case 1:
		UnlockValue = world1_stat[levelID-1];
		break;

		case 2:
		UnlockValue = world2_stat[levelID-1];
		break;

		case 3:
		UnlockValue = world3_stat[levelID-1];
		break;
	}

	switch(UnlockValue)
	{
		case 0:
		if(LevelCleared && DiamantGrabed)
		{
			UnlockValue = 3;
		}
		else if(LevelCleared)
		{
			UnlockValue = 1;
		}
		else if(DiamantGrabed)
		{
			UnlockValue = 2;
		}
		break;

		case 1:
		if(DiamantGrabed)
		{
			UnlockValue = 3;
		}
		break;

		case 2:
		if(LevelCleared)
		{
			UnlockValue = 3;
		}
		break;

		case 3:
			return;
		break;
	}

	switch(episodeID)
	{
		case 1:
		world1_stat[levelID-1] = UnlockValue;
		break;

		case 2:
		world2_stat[levelID-1] = UnlockValue;
		break;

		case 3:
		world3_stat[levelID-1] = UnlockValue;
		break;
	}
}

