void level_Affiche(int x_offset, int y_offset)
{
	int		col_offset;
	int		lgn_offset;
	int		pos;
	int		colonne;
	int		ligne;
	int		numero;
	int		xdepart;
	int		ydepart;
	int		xcopie;
	int		ycopie;
	pEnt	Ent;
	int		scroll_xmax = TILE_X*gHeader.level_w - ScreenX;
	int		scroll_ymax = TILE_Y*gHeader.level_h - ScreenY;
	int		xpos_item;
	int		ypos_item;

	if(!table)				return;
	if(gLevelLoaded != 1)	return;

	col_offset = 0;
	if(x_offset >= TILE_X)
	{
		col_offset = x_offset / TILE_X;
		x_offset = x_offset - (col_offset*TILE_X);
	}
	else if(x_offset < 0)
	{
		col_offset = x_offset / TILE_X;
		x_offset = x_offset + (col_offset*TILE_X);
	}

	lgn_offset = 0;
	if(y_offset >= TILE_Y)
	{
		lgn_offset = y_offset / TILE_Y;
		y_offset = y_offset - (lgn_offset*TILE_Y);
	}
	else if(y_offset < 0)
	{
		lgn_offset = y_offset / TILE_Y;
		y_offset = y_offset + (lgn_offset*TILE_Y);
	}

	for(colonne=-col_offset ; colonne < gHeader.level_w-col_offset ; colonne++)
	{
		for(ligne=0 ; ligne < gHeader.level_h ; ligne++)
		{
			pos = ((ligne+lgn_offset)*gHeader.level_w)+colonne+col_offset;
			if(pos < 0 || pos >= gHeader.level_w*gHeader.level_h)
				continue;

			numero = gLevel[pos].blocID - 48;
			if(numero < 0 || numero > 127)
				numero = 0;
				
			if(numero == 0)
				continue;

			// recupere les entites du level
			if(numero == PLAYER_ID)
			{
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER1_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER1_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER1_FH-TILE_Y)/2;
				g_AddSprite(ENT_MONSTER1, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER2_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER2_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER2_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER2, xpos_item, ypos_item, 0, 0, false);
				Ent->move_state = MOVE_HB;
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER2b_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER2_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER2_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER2, xpos_item, ypos_item, 0, 0, false);
				Ent->move_state = MOVE_GD;
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER2c_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER2_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER2_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER2, xpos_item, ypos_item, 0, 0, false);
				Ent->move_state = MOVE_ROT;
				gLevel[pos].blocID = VOID_ID + 48;
				// randomize la rotation
				sprite_RandomizeRotation(Ent);
				continue;
			}
			else if(numero == MONSTER3_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER3_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER3_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER3, xpos_item, ypos_item,0,0,false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER4_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER4_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER4_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER4, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER5_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER5_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER5_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER5, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == MONSTER6_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (MONSTER6_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (MONSTER6_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_MONSTER6, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == LIFEUP_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (LIFEUP_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (LIFEUP_FH-TILE_Y)/2;
				g_AddSprite(ENT_LIFEUP, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == EXITAD_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (EXITAD_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (EXITAD_FH-TILE_Y)/2;
				g_AddSprite(ENT_EXITAD, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == HLIFT_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (HLIFT_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (HLIFT_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_HLIFT, xpos_item, ypos_item, 0, 0, false);
				Ent->lift_type = HLIFT_ID;
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == RLIFT_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (HLIFT_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (HLIFT_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_HLIFT, xpos_item, ypos_item, 0, 0, false);
				Ent->lift_type = RLIFT_ID;
				gLevel[pos].blocID = VOID_ID + 48;
				// randomize la rotation
				sprite_RandomizeRotation(Ent);
				continue;
			}
			else if(numero == POMME_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (POMME_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (POMME_FH-TILE_Y)/2;
				g_AddSprite(ENT_POMME, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == KEY_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (KEY_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (KEY_FH-TILE_Y)/2;
				g_AddSprite(ENT_KEY, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == BANANE_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (BANANE_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (BANANE_FH-TILE_Y)/2;
				g_AddSprite(ENT_BANANE, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == BUMPER_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (BUMPER_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (BUMPER_FH-TILE_Y)/2;
				g_AddSprite(ENT_BUMPER, xpos_item, ypos_item, 0, 0, false);
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == DIAMANT_ID)
			{
				xpos_item = -x_offset + (TILE_X*colonne) - (DIAMANT_FW-TILE_X)/2;
				ypos_item = -y_offset + (TILE_Y*ligne) - (DIAMANT_FH-TILE_Y)/2;
				Ent = g_AddSprite(ENT_DIAMANT, xpos_item, ypos_item, 0, 0, false);
				//Ent->nframe = 1;
				Ent->nframe = 0;
				gLevel[pos].blocID = VOID_ID + 48;
				continue;
			}
			else if(numero == EXIT_ID)
			{
				continue;
			}

			xcopie = TILE_X*colonne;
			ycopie = TILE_Y*ligne;


			// cela corrige l'ecriture de tile en dehors de l'ecran qui plantait sur le pc de ndeal

			if(xcopie-x_offset > (int)ScreenX)
				continue;
			if(xcopie-x_offset + TILE_X < 0)
				continue;

			if(ycopie-y_offset > (int)ScreenY)
				continue;
			if(ycopie-y_offset + TILE_Y < 0)
				continue;


			xdepart = (numero / (int)(ScreenY/TILE_Y)) * TILE_X;
			ydepart = (numero % (int)(ScreenY/TILE_Y)) * TILE_Y;

						
		//	blit(table, xdepart, ydepart, xcopie-x_offset, ycopie-y_offset, TILE_X, TILE_Y, true); 
			blit(background, xdepart, ydepart+520, xcopie-x_offset, ycopie-y_offset, TILE_X, TILE_Y, true); 
		}
	}
}

